def precision():
    df = pd.read_csv(r'functions_2.csv')
    func_holder = [df['Func 1'].tolist(), df['Func 2'].tolist(), df['Func 3'].tolist(), df['Func 4'].tolist(),
                   df['Func 5'].tolist(), df['Func 6'].tolist(), df['Func 7'].tolist(), df['Func 8'].tolist(),
                   df['Func 9'].tolist(), df['Func 10'].tolist()]
    for i in range(len(func_holder)):
        for j in range(len(func_holder[i])):
            if func_holder[i][j] > -0.005:
                func_holder[i][j] = 0

            elif func_holder[i][j] > -0.015:
                func_holder[i][j] = -0.010

            elif func_holder[i][j] > -0.025:
                func_holder[i][j] = -0.020

            else:
                func_holder[i][j] = -0.030


    df = pd.DataFrame(list(zip(func_holder[0], func_holder[1], func_holder[2], func_holder[3], func_holder[4],
                               func_holder[5], func_holder[6], func_holder[7], func_holder[8], func_holder[9])),
                      columns=['Func 1', 'Func 2', 'Func 3', 'Func 4', 'Func 5', 'Func 6', 'Func 7', 'Func 8', 'Func 9'
                               , 'Func 10'])
    df.to_csv('precision_2.csv')


